(function ($, Drupal) {
  Drupal.behaviors.backToTopButton = {
    attach: function (context) {
      const container = $(".nygov-back-to-top", context).once('backToTopButton') || undefined;
      if(container === undefined) return;
      $(container).on('click', Drupal.behaviors.backToTopButton.backToTop);
      $(window).on('scroll', () => {
        Drupal.behaviors.backToTopButton.processScrolling(container);
      });
    },
    processScrolling: function (container) {
      const scrolled = window.pageYOffset;
      const scrollPoint = 480;
      if (scrolled > scrollPoint) {
        $(container).addClass('nygov-back-to-top-show');
        $(container).removeClass('nygov-back-to-top-hidden');
      }
      if (scrolled < scrollPoint) {
        $(container).removeClass('nygov-back-to-top-show');
        $(container).addClass('nygov-back-to-top-hidden');
      }
    },
    backToTop: function () {
      if (window.pageYOffset > 0) {
        window.scrollBy(0, -80);
        setTimeout(Drupal.behaviors.backToTopButton.backToTop, 0);
      }
    }
  }
})(jQuery, Drupal)
